import "./Footer.css";
import Wave from "../../img/wave.png";
import Insta from "@iconscout/react-unicons/icons/uil-instagram";
import Facebook from "@iconscout/react-unicons/icons/uil-facebook";
import Gitub from "@iconscout/react-unicons/icons/uil-github";
import Phone from "@iconscout/react-unicons/icons/uil-phone"
import Email from "@iconscout/react-unicons/icons/uil-fast-mail"
import Location from "@iconscout/react-unicons/icons/uil-location-point"

const Footer = () => {
  return (
    <>
    <div className="footer">
      <img src={Wave} alt="" style={{ width: "100%" }} />
      <div className="f-content">
      <div class="box-thenk">
          <h3 className="thenk">Shoaib's Portfolio</h3>
          <p className="then">Thank you for visiting my personal portfolio <br /> website. Connect with me over socials. <br/></p>
      </div>
      <div className="right">
        <div class="box">
          <h3>contact info</h3>
          <p> <Phone color="white" size={"1rem"} />+92 304-6413094</p>
          <p> <Email color="white" size={"1.5rem"} />sho03046413094@gmail.com</p>
      </div>
        <div className="f-icons">
        <a href="https://www.instagram.com/shoaib.ali.5245/" target="blank"><Insta color="white" size={"3rem"} /></a>
        <a href="https://www.facebook.com/shahzaibali.ali.5245" target="blank"> <Facebook color="white" size={"3rem"} /></a>
        <a href="https://github.com/Shoaib11229900" target="blank"><Gitub color="white" size={"3rem"} /></a>
        </div>
        </div>
      </div>
    </div>
     </>
  );
};

export default Footer;
